import PropTypes from 'prop-types';
import {filter,changeFilter} from '../Redux/ContactsSlice'
export const Filter = () => {

    return (<div>
            <h3>Find contacts by name</h3>
            <input type="text" value={filter} onChange={evt => changeFilter(evt)} />
        </div>
    )
}
Filter.propTypes = {
  filter: PropTypes.string,
  filterChange: PropTypes.func
}
